import PySimpleGUI as sg
import base64

logo = base64.b64decode('')

def intro():
    sg.theme('SystemDefaultForReal')
    layout = [  [sg.Text('Welcome to TikBot!', size = (15,1))],
                [sg.Radio('Upload compilation to Youtube via TickBot',"Rad1", default=True), sg.Radio('Save file locally', "Rad1")],
                [sg.Button('Next'), sg.Button('Cancel')] ]
    window = sg.Window('TikBot ', layout, icon = logo )
    while True:
        event, values = window.read()
        if event in (None, 'Cancel'): 
            break
        window.close()
        return values[0]
    
def main():
    decision = intro()
    if decision:
        print('does one thing')
    else:
        print('does another')
    
    
main()





